var student1 = {
    firstName: "Rihanna",
    lastName: "Badgal",
    age: 37,
    location: "Barbados"
};
var student2 = {
    firstName: "Vivian",
    lastName: "Wilson",
    age: 21,
    location: "LA"
};
var studentsList = [student1, student2];
// --------------- Creating a table containing the students ------------ //
var table = document.createElement('table');
table.style.borderCollapse = 'collapse';
// Header -----------------------------------
var header = document.createElement('tr');
var names = document.createElement('th');
names.textContent = 'First Name';
var locations = document.createElement('th');
locations.textContent = 'Location';
header.appendChild(names);
header.appendChild(locations);
table.appendChild(header);
// Rows -------------------------------------
studentsList.forEach(function (student) {
    var row = document.createElement('tr');
    var name = document.createElement('td');
    name.textContent = student.firstName;
    var location = document.createElement('td');
    location.textContent = student.location;
    row.appendChild(name);
    row.appendChild(location);
    table.appendChild(row);
});
document.body.appendChild(table);

